import React, { useState } from 'react';

const AjouterSt = () => {
    const [NouveauStg,SetNouveauStg]=useState({nom:"",prenom:"",image:"",email:""})
    return (
        <>
            <form>
                <fieldset>
                    <label> Image  : </label>
                    <input type='text' id='image'onChange={(e)=>SetNouveauStg({...NouveauStg,image: e.target.value})} /><br/>
                    <label> Nom : </label>
                    <input type='text' id='nom' onChange={(e)=>SetNouveauStg({...NouveauStg,nom: e.target.value})}/><br/>
                    <label> Prenom : </label>
                    <input type='text' id='prenom'/><br/>
                    <label>Email : </label>
                    <input type='text' id='email'/><br/>
                </fieldset>
            </form>
        </>
    );
}

export default AjouterSt;
